// SatelliteInsights.jsx
// React page for Satellite Crop Health feature
// Allows user to input crop, latitude, longitude and fetch NDVI from backend

import React, { useState } from 'react';
import axios from 'axios';

const CROPS = ['Wheat', 'Rice', 'Maize', 'Soybean', 'Barley', 'Sugarcane'];

function StatusCircle({ status, ndvi }) {
  let color = 'bg-gray-300';
  if (status === 'Healthy') color = 'bg-green-400';
  else if (status === 'Moderate') color = 'bg-yellow-400';
  else if (status === 'Poor') color = 'bg-red-400';
  return (
    <div className="flex flex-col items-center my-4">
      <div className={`w-24 h-24 rounded-full flex items-center justify-center text-2xl font-bold text-white shadow-lg ${color}`}>{ndvi ?? '--'}</div>
      <div className="mt-2 text-lg font-semibold">{status ?? 'No Data'}</div>
    </div>
  );
}

function SatelliteInsights() {
  const [crop, setCrop] = useState(CROPS[0]);
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setResult(null);
    try {
      const resp = await axios.post('/api/satellite-insights', {
        crop,
        latitude: parseFloat(latitude),
        longitude: parseFloat(longitude)
      });
      setResult(resp.data);
    } catch (err) {
      setError(err.response?.data?.error || 'Unable to fetch satellite data.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="w-full min-h-screen flex items-center justify-center bg-gradient-to-br from-green-50 to-emerald-100 py-6 px-2 sm:px-4 md:px-6">
      <div className="w-full max-w-lg bg-white rounded-xl shadow-lg p-4 sm:p-6 md:p-8">
        <h2 className="text-xl sm:text-2xl font-bold mb-4 text-center">Satellite Crop Health</h2>
        <form className="space-y-4" onSubmit={handleSubmit}>
          <div>
            <label className="block font-medium mb-1">Crop Type</label>
            <select className="w-full border rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-200" value={crop} onChange={e => setCrop(e.target.value)}>
              {CROPS.map(c => <option key={c}>{c}</option>)}
            </select>
          </div>
          <div className="flex flex-col sm:flex-row sm:space-x-4 space-y-2 sm:space-y-0">
            <div className="flex-1">
              <label className="block font-medium mb-1">Latitude</label>
              <input type="number" step="0.0001" className="w-full border rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-200" value={latitude} onChange={e => setLatitude(e.target.value)} required />
            </div>
            <div className="flex-1">
              <label className="block font-medium mb-1">Longitude</label>
              <input type="number" step="0.0001" className="w-full border rounded px-3 py-2 focus:outline-none focus:ring-2 focus:ring-blue-200" value={longitude} onChange={e => setLongitude(e.target.value)} required />
            </div>
          </div>
          <button type="submit" className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700 transition disabled:opacity-60" disabled={loading}>
            {loading ? 'Fetching...' : 'Get Satellite Data'}
          </button>
        </form>
        {error && <div className="mt-4 text-red-600 text-center">{error}</div>}
        {result && (
          <div className="mt-6 flex flex-col items-center">
            <StatusCircle status={result.status} ndvi={result.ndvi} />
            {result.image_url && (
              <img src={result.image_url} alt="Satellite preview" className="mt-4 rounded shadow w-36 h-36 sm:w-48 sm:h-48 object-cover" />
            )}
          </div>
        )}
      </div>
    </div>
  );
}

export default SatelliteInsights;
